import { useState } from "react"
import { BACKGROUND } from "../helpers/colors";

const Test = () => {
    const [count, setCount] = useState(0);

    const changeCount = () => {
        setCount(count + 1)
    }

    return (
        <p style={BACKGROUND} onClick={changeCount}></p>
    )
}

export default Test
